import React, { useState, useEffect } from 'react';

function Create(){

    const [data, setData] = useState({
        name: "",
        direction: "",
        image: "",
        price: "",
        operation: "",
        ambients: "",
        m2: "",
        description: ""
    });

    const handleSubmit = (event) => {
      // prevents the submit button from refreshing the page
      event.preventDefault();
      setContactInfo({ name: "", direction: "", image: "", price: "" });
      console.log(data);
    };

    const apiURL = "/NodeTest/api/database/post";

    let fetchAPI = async() =>{
      console.log(data);
      const res = await fetch(apiURL, 
      {
        method: 'POST', // or 'PUT'
        headers: { 'Content-Type': 'application/json',},
        body: JSON.stringify(data),}
      );
      return res;
    }

    /*useEffect(() =>{
      fetchAPI()
      .then(res => {
        return res.json()
      }).catch( err => {
        console.log("fetch error" + err);
      })
    }, []);*/

    return(
        <div>
            <h1>Subir Propiedad Nueva</h1>
            <form>
              <input 
                name="name" 
                placeholder='Nombre Propiedad'
                value={data.name}
                type="text" required/>
              <input 
                name="direction" 
                placeholder='Direccion'
                value={data.direction}
                type="text" required />
              <input 
                name="image" 
                placeholder='Imagen'
                value={data.image}
                required />
              <input 
                name="price" 
                placeholder='Precio'
                value={data.price} 
                type="number" required />
              <select name="operation" value={data.operation} required>
                    <option value="SELL">Vender</option>
                    <option value="RENT">Alquilar</option>
                </select>
              <input 
                name="ambients" 
                placeholder='Ambientes'
                value={data.ambients}
                type="number" required />
              <input 
                name="m2" 
                placeholder='Metros Cuadrados'
                value={data.m2}
                type="number" required />
              <textarea 
                name="description" 
                placeholder='Descripcion'
                value={data.description}
                required/>
            </form>
            <button type='submit' onClick={handleSubmit}>
              Subir Propiedad Nueva
            </button>
        </div>
    );
}

export default Create;
